import { Routes, Route } from "react-router-dom";
import "./App.css";
import SignIn from "./pages/SignIn";
import SignUp from "./pages/SignUp";
import NotFound from "./pages/NotFound";
import HomePage from "./pages/HomePage/HomePage";
import ProtectedRoute from "./components/PrivateRoute";
import Dashboard from "./pages/Dashboard";

const App = () => {
const user = 1;
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="signin" element={<SignIn />} />
        <Route path="signup" element={<SignUp />} />
        {user ? (
            <Route
              path="/"
              element={

                  <Dashboard authorised={true} />

              }
            >
              <Route
                path="dashboard" 
                exact
                element={

                    <Dashactivity />

                }
              />
              <Route
                path="course" 
                element={

                    <Course />

                }
              />
              <Route
                path="course/:id" 
                element={

                    <Course />

                }
              />
              <Route
                path="newcourse" 
                element={

                    <Newcourse />

                }
              />
              <Route
                path="newcourse/:id" 
                element={

                    <NewcourseDetail />

                }
              />
              <Route
                path="cart"
                element={

                    <Cart />

                }
              />

              <Route
                path="payment"
                element={

                    <Payment />

                }
              />
              <Route
                path="event"
                element={

                    <Event />

                }
              />
              <Route
                path="inbox"
                element={

                    <Inbox />

                }
              />

              <Route
                path="assessment"
                element={

                    <Assessment />

                }
              />
              <Route
                path="resources"
                element={

                    <Resources />

                }
              />
               <Route
                path="resources/:id" 
                element={

                    <ResourcesDetail />

                }
              />
              <Route
                path="profile"
                element={

                    <Profile />

                }
              />
              <Route
                path="support"
                element={

                    <Support />

                }
              />
            </Route>
          ) : (
          // <Route path="*" element={<ErrorPage />} />

            <Route
              path="*"
              element={
                <div className="transition-page">
                <div className="transtion-box">
                  <span className="wave-item">ErrorPage</span>
                  <span className="wave-item"></span>
                  <span className="wave-item"></span>
                  <span className="wave-item"></span>
                  <span className="wave-item"></span>
                </div>
              </div>
              }
            />
          )}
        <Route path="*" element={<NotFound />}/>

      </Routes>
    </div>
  );
}

export default App;
